import React from "react";

export default class Main extends React.Component {
    render () {
        return(
            <main class="main">
                <section class="user">
                    <div class="user__profile">
                        <img class="user__image" alt="Аватар" />
                        <div class="user__image-overlay" onClick={this.handleEditAvatarClick}></div>
                        <h1 class="user__name"></h1>
                        <p class="user__info"></p>
                        <button class="user__change-button" type='button'></button>
                        <button class="user__add-button" type='button' onClick={this.handleEditPlaceClick}></button>
                    </div>
                </section>
                <section class="places">
                </section>
            </main>
        )
    }
    handleEditPlaceClick () {
            document.querySelector('.popup_type_card').classList.add('popup_active')
    }
    handleEditAvatarClick () {
        console.log(1)
        document.querySelector('.popup_type_edit-avatar').classList.add('poup_active')
    }
    // handleEditProfileClick
}
